import React from 'react';
import {useParams} from 'react-router-dom'
const User = ({match})=>{
    return <h1> Parameter pass with Match method {match.params.name} </h1>
}

const UserName = ()=>{  
    const {fname,lname} = useParams()
    return <h1> using useParams {fname} {lname} </h1>
}

export default User;
export {UserName};
